import React from 'react';
import styled from 'styled-components';
import about1 from '../assets/about1.png';
import about2 from '../assets/about2.png';
import { Link } from 'react-router-dom';

const HeroContainer = styled.section`
  width: 1552px;
  height: 234px;
  margin: 48px auto 0 auto;
  border-radius: 6px;
  background: #004C97;
  display: flex;
  align-items: center;
  justify-content: center;
  @media (max-width: 1600px) {
    width: 98vw;
    min-width: 320px;
  }
`;

const HeroText = styled.h1`
  width: 414px;
  height: 144px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 96px;
  line-height: 150%;
  letter-spacing: -2.3%;
  color: #FFFFFF;
  margin: 0;
  text-align: center;
`;

const MainSection = styled.section`
  width: 100%;
  max-width: 1552px;
  margin: 48px auto 0 auto;
  border-radius: 6px;
  background: #E9F6FF;
  border: 4px solid #A4D6FF;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 72px;
  box-sizing: border-box;
`;

const TextContent = styled.div`
  width: 752px;
  padding-right: 32px;
`;

const MissionTitle = styled.h2`
  width: 373px;
  height: 96px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 64px;
  line-height: 150%;
  letter-spacing: -2.2%;
  color: #1E1E1E;
  margin: 0 0 32px 0;
`;

const MissionText = styled.p`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 500;
  font-size: 28px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #1E1E1E;
  margin: 0;
`;

const ImageContainer = styled.div`
  width: 605.78px;
  height: 653px;
`;

const MissionImage = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

const WhyUsSection = styled.section`
  width: 100%;
  max-width: 1552px;
  margin: 48px auto;
  padding: 0 72px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: flex-start;
`;

const WhyUsContent = styled.div`
  width: 1030px;
  padding-right: 32px;
`;

const WhyUsTitle = styled.h2`
  width: 254px;
  height: 96px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 700;
  font-size: 64px;
  line-height: 150%;
  letter-spacing: -2.2%;
  color: #1E1E1E;
  margin: 0 0 32px 0;
`;

const BulletList = styled.ul`
  list-style-type: disc;
  padding-left: 24px;
  margin: 0;
  font-family: 'Avenir Next', sans-serif;
`;

const BulletItem = styled.li`
  font-family: 'Avenir Next', sans-serif;
  font-weight: 500;
  font-size: 28px;
  line-height: 150%;
  letter-spacing: -1.9%;
  color: #1E1E1E;
  margin-bottom: 16px;
`;

const CircularImage = styled.img`
  width: 468px;
  height: 460px;
  border-radius: 50%;
  object-fit: cover;
`;

const ConnectButton = styled(Link)`
  display: inline-block;
  padding: 16px 32px;
  background: #FF6B00;
  color: white;
  text-decoration: none;
  border-radius: 4px;
  font-family: 'Avenir Next', sans-serif;
  font-weight: 600;
  font-size: 18px;
  margin-top: 32px;
  
  &:hover {
    background: #FF8533;
  }
`;

const About = () => (
  <>
    <HeroContainer>
      <HeroText>About Us</HeroText>
    </HeroContainer>
    
    <MainSection>
      <TextContent>
        <MissionTitle>Our mission</MissionTitle>
        <MissionText>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean tincidunt mauris nulla, sed efficitur dui sollicitudin eu. Nulla lacinia a ex in rhoncus. Quisque vitae viverra nisi, non lacinia elit. Suspendisse iaculis enim vel eros blandit, volutpat vehicula ante scelerisque. Nulla facilisi. Proin sit amet augue eu metus pharetra rutrum. Interdum et malesuada fames ac ante ipsum primis in faucibus.<br/><br/>
          Aenean id ipsum leo. Vestibulum ultricies eleifend nulla, sed aliquet massa malesuada at. Morbi vel posuere nisi. Donec a tortor sit amet mi sollicitudin aliquam. Proin at eros eu mauris interdum feugiat ac eu purus. ut egestas justo, sed condimentum lacus turpis ut metus.
        </MissionText>
      </TextContent>
      <ImageContainer>
        <MissionImage src={about1} alt="Our mission illustration" />
      </ImageContainer>
    </MainSection>
    
    <WhyUsSection>
      <WhyUsContent>
        <WhyUsTitle>Why us?</WhyUsTitle>
        <BulletList>
          <BulletItem>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</BulletItem>
          <BulletItem>Aenean suscipit velit vel interdum bibendum.</BulletItem>
          <BulletItem>Duis auctor erat vel tellus porttitor, vel fermentum tellus tincidunt.</BulletItem>
          <BulletItem>Pellentesque pharetra felis at elit cursus, nec auctor odio facilisis.</BulletItem>
        </BulletList>
        <ConnectButton to="/contact">Let's Connect â†’</ConnectButton>
      </WhyUsContent>
      <CircularImage src={about2} alt="Why choose us illustration" />
    </WhyUsSection>
  </>
);

export default About;
